The General's Daughter (1999)
R | 116 min | Drama, Mystery, Thriller | 18 June 1999 (USA)

The naked corpse of Captain Elisabeth Campbell, daughter of Lieutenant General &quot;Fighting Joe&quot; Campbell, is found staked out on the urban warfare range of Fort MacCallum. Army CID detectives and ex-lovers Paul Brenner and Sara Sunhill are called in to investigate, and find themselves wrapped up in a maelstrom of sexual impropriety and misguided face-saving.

Stars: John Travolta, Madeleine Stowe, James Cromwell 


